import React, { Component } from 'react';

class FilterBar extends Component {
  constructor(props) {
    super(props);

    this.state = {
      filter: 'all',
    }
  }

  render() {
    return (
      <form className="mb-2 ">
        <label>
          <input name="all" type="radio" checked />
          <span>All</span>
        </label>
      </form>
    );
  }
}

export default FilterBar;
